    --typography-fontFamily: 'open sans'; /* fontFamily for the entire survey */
    --typography-headline-size: 16px; /* component headline */
    --typography-subHeadline-size: 14px; /* description/error */
    --typography-body-size: 14px; /* content,options,placeholders, error */
    
    --typography-bodyLarge-weight: 600; /* rating text */
    --typography-bodyLarge-size: 16px; /* Date text */
    
    --palette-core-primary: #4050C6; /* group-mark-background, action-active/hover */
    --palette-core-canvas: #FFFFFF; /* survey background*/
    --palette-core-components: #FFFFFF; /* components background */
    --palette-core-outline: rgba(44, 53, 72, 0.15); /* component outline */
    --palette-typography-body: #121826; /* content,options */
    --palette-typography-headline: #121826; /* component headline */
    --palette-typography-subHeadline: rgba(18, 24, 38, .7); /* component description */
    --palette-typography-error: #BE0406; /* error message */
    --palette-typography-placeholder: rgba(18, 24, 38, .7); /* component placeholder */
    --palette-typography-poweredby: #2C3548; /* footers poweredby text color */
    --palette-typography-user-input: #000; /* input fields value color */
    --palette-typography-link: #2467C6; /* link inside Label component */
    --palette-action-hover: var(--palette-core-primary); /* hover style, mainly affects component border */
    --palette-action-active: var(--palette-core-primary); /* active/selected style, affects component border or background */
    --palette-group-inner-mark : #ffffff; /* mark color for group - checkbox/radio */
    --palette-group-mark-background: var(--palette-core-primary); /* mark background for group - checkbox/radio */
    --palette-rating-custom-hover: rgba(254, 215, 44, .7);; /* hover color for start/emoticons */
    --palette-rating-custom-selected: #FED72C; /* active color for start/emoticons */
    --palette-rating-custom-outline: var(--palette-typography-placeholder); /* normal and hover outline color for start/emoticons */
    --palette-rating-custom-selected-outline: var(--palette-typography-body); /* selected outline color for start/emoticons */
    --palette-rating-number-hover:var(--palette-core-primary); /* hover outline for rating type number */
    --palette-rating-number-selected: var(--palette-core-primary); /* selected color for rating number */
    --palette-rating-number-text-hover: var(--palette-typography-body);
    --palette-rating-number-text-selected: var(--palette-core-components); 
    --palette-rating-number-text-selected-hover: var(--palette-core-components); 
    --palette-rating-number-text: var(--palette-typography-body);

    --survey-footer-buttons-gap: 8px; /* gap between footer buttons */
    --survey-footer-buttons-justify: center; /* align footer button (1 page)*/
    --survey-footer-multi-page-buttons-justify: flex-end; /* align footer button (multi page) */

    --survey-sides-padding: 30px; /* survey sides padding */
    --survey-padding: 0 var(--survey-sides-padding);

    --margin-subHeadline: 4px 0 0 0; /* margin subHeadline */
    --margin-validationError: 8px 0 0 0; /* margin validationError */
    --base-headlines-margin: 0 0 10px 0; /* margin Headlines - label and description */
    --questions-spacing: 40px; /* vertical spacing between survey fields */
    
    --powered-by-display: flex; /* display type for medallia's logo - can be modified to none in order to hide */
    --powered-by-justify: center; /* align medallia's logo */

    --filter-for-light-contrast: brightness(0) saturate(100%); /* black color*/
    --filter-for-dark-contrast: brightness(0) saturate(100%) invert(100%) sepia(0%) saturate(7500%) hue-rotate(345deg) brightness(93%) contrast(115%); /* white color */
}

body {
	font-family: var(--typography-fontFamily);
	display: flex;
    flex-direction: column;
	justify-content: center;
	align-items: center;
}

form {
	margin: 0;
    height: inherit;
}

form main {
    flex: 1;
    overflow-y: auto;
    padding: 0 2px;
    display: block;
    position: sticky;
}

form footer {
    margin-top: 10px;
}

input,
textarea {
    background-color: var(--palette-core-components);
